collection.description:
&lt;p&gt;
					This collection is exported from the Koori Health Research Database. It contains data for the purpose of basic demographic survival analysis and life expectancy calculations. The exported data includes for each person in the database:&lt;/p&gt;
				&lt;ul&gt;
					&lt;li&gt;
						person&amp;#39;s name, gender and identifiying database number&lt;/li&gt;
					&lt;li&gt;
						counts of children and marriages&lt;/li&gt;
					&lt;li&gt;
						flag indicating dead or alive&lt;/li&gt;
					&lt;li&gt;
						calculations of age (separate data provided whether dead or alive) in years at last birthday and total days&lt;/li&gt;
					&lt;li&gt;
						underlying dates of birth and death including indicators of certainty, and date estimates as a date, a julian day, and decade&lt;/li&gt;
					&lt;li&gt;
						id, name and birth/death date of the persons mother and father&lt;/li&gt;
				&lt;/ul&gt;
				&lt;p&gt;
					Depending on the access rights granted to recipients of this collection, this data may be:&lt;/p&gt;
				&lt;ul&gt;
					&lt;li&gt;
						anonymised to prevent identification of individuals;&lt;/li&gt;
					&lt;li&gt;
						a subset of the total population suitable for the family group and/or individual recipient;&lt;/li&gt;
				&lt;/ul&gt;
				&lt;p&gt;
					The contents of this output collection include:&lt;/p&gt;
				&lt;ul&gt;
					&lt;li&gt;
						a tab delimited file containing a heading row, and one row per person, tab delimited, for import into the researcher&amp;#39;s analytical tool of choice&lt;/li&gt;
					&lt;li&gt;
						a codebook showing the distinct values for each field in the file (one text file per field)&lt;/li&gt;
					&lt;li&gt;
						a readme file providing a detailed description of the contents of each field&lt;/li&gt;
				&lt;/ul&gt;

&lt;p&gt;
					This collection is the original input file for the Koori Health Research Database instance of a Founders and Survivors: Genealogical Connections database. It is a flat file containing one record for each member of the population. As well as names and birth/death dates and places, the file records a persons parents (single text field) and up to 3 marriages. Copies of a variety of transcribed birth, marriage, and death certificates are included in each persons record. This means that the saqme source document is often duplicated across different persons.&lt;/p&gt;
				&lt;p&gt;
					Reconstruction of birth, death, and marriages in a form suitable to be loaded as life course events is required.&lt;/p&gt;
				&lt;p&gt;
					Another major part of the load is to disaggregate source data transcripts so that only one copy of the source is loaded, and multiple citations to multiple events and participants, as per the Founders and Survivors: Genealogical Connections database data model, can be reconstructed. This process will probably require considerable human assistance.&lt;/p&gt;
				&lt;p&gt;
					Detailed specifications for what the source dataset contains and how it is used to load the Yggdrasil database instance:&lt;/p&gt;
				&lt;ul&gt;
					&lt;li&gt;
						&lt;p&gt;
							A &lt;a href="http://founders-and-survivors.org/y/pub/uml/KHRD_input_records_final.png"&gt;Diagram of the workflow used to load this collection as an Yggdrasil database instance&lt;/a&gt; is available.&lt;/p&gt;
					&lt;/li&gt;
					&lt;li&gt;
						&lt;p&gt;
							Parts of this workflow are automated and data driven by an XML Data Dictionary. The &lt;a href="http://founders-and-survivors.org/y/pub/uml/khrd-datadict.xml"&gt;data dictionary&lt;/a&gt; may be browsed. The &lt;b&gt;map&lt;/b&gt; and &lt;b&gt;datamodel&lt;/b&gt; elements in the data dictionary define the columns in the flat input file, and their conversion to an XML person-event model based on the way the Text Encoding Initiative handles &lt;a href="http://www.tei-c.org/release/doc/tei-p5-doc/en/html/ND.html"&gt;Names, Dates, People and Places&lt;/a&gt;.&lt;/p&gt;
					&lt;/li&gt;
				&lt;/ul&gt;

&lt;p&gt;
					This collection is a set of google document spreadsheets and web captured research data which has been outsourced to volunteer members of the public in order to capture additional data about all convicts whom were transported to Van Diemen&amp;#39;s Land on selected convict ships.&lt;/p&gt;
				&lt;p&gt;
					For each ship the assigned volunteer is provided with an editable google spreadsheet containing one row per convict who arrived on that ship. Each row links to known data about the convict and the volunteers conduct extensive research to gather new data and to encode known data as guided by the columns of the spreadsheet. Volunteers also submit information about each convict&amp;#39;s death, descendants and whether the convict has an ancestor who enlisted in the AIF during WWI. The volunteers enter standardised county names for convict births and places of conviction into the ship&amp;#39;s spreadsheet.&lt;/p&gt;
				&lt;p&gt;
					The volunteers receive training, documentation, and attend regular workshops to review progress of their research.&lt;/p&gt;

&lt;p&gt;
					The WWI AIF Enlistment Records Tasmanian born dataset is the core input to the database load for the Convicts and Diggers database service. It forms the base population for this database.&lt;/p&gt;
				&lt;p&gt;
					A copy of the dataset was provided by the National Archives of Australia (NAA). It contains the following data fields:&lt;/p&gt;
				&lt;ul&gt;
					&lt;li&gt;
						barcode: provides the key to lookup images of the digger&amp;#39;s AIF service records at the NAA e.g. barcode &amp;quot;3063045&amp;quot; enables access to imaged enlistment records at &lt;a href="http://recordsearch.naa.gov.au/scripts/Imagine.asp?B=1709953"&gt;http://recordsearch.naa.gov.au/scripts/Imagine.asp?B=1709953&lt;/a&gt;.&lt;/li&gt;
					&lt;li&gt;
						controlSymbol: NAA name label e.g. &amp;quot;SMITH, A&amp;quot;.&lt;/li&gt;
					&lt;li&gt;
						name: surname, forename e.g. &amp;quot;Smith, Albert&amp;quot;&lt;/li&gt;
					&lt;li&gt;
						surname: enlistee&amp;#39;s surname&lt;/li&gt;
					&lt;li&gt;
						forename: enlistee&amp;#39;s forenames&lt;/li&gt;
					&lt;li&gt;
						birthplace: place of birth (Tasmanian placenames only) e.g. Richmond, TAS, Australia&lt;/li&gt;
					&lt;li&gt;
						enlistment place: where the person enlisted e.g. Melbourne, VIC, Australia&lt;/li&gt;
					&lt;li&gt;
						next of kin: surname, forename and relationship of the next of kin e.g. &amp;quot;Smith, Florence (wife)&amp;quot;&lt;/li&gt;
					&lt;li&gt;
						officer flag: &amp;quot;y&amp;quot; if the enlistee was an officer&lt;/li&gt;
				&lt;/ul&gt;

			&lt;p&gt;
Groundwater research in Australia is entering an exciting new era. The Commonwealth and State governments have come together around the National Water Initiative. Groundwater investigations are highlighted in the National Groundwater Assessment Initiative which targets gaps in our knowledge about groundwater.&lt;br /&gt;
&lt;br /&gt;
Now, we have the National Centre for Groundwater Research and Training (NCGRT). For the first time researchers and professionals from many disciplines are pooling their expertise in five major research programs to unlock the secrets of Australia’s sub surface water systems. These programs reflect extensive consultations with state governments and industry: those who manage our water and the technologies and systems that are required to deliver it to users.&lt;br /&gt;
&lt;br /&gt;
Groundwater is often called the forgotten resource. Despite the fact that groundwater accounts for over 30 per cent of Australia’s water consumption, we simply do not know enough about this vital water resource, and how to manage it.&lt;br /&gt;
&lt;br /&gt;
With severe droughts and climate change placing extreme pressure on existing water supplies, there is an urgent need to expand this knowledge base.&lt;br /&gt;
&lt;br /&gt;
The NCGRT will coordinate the efforts of nearly 200 Australian and international researchers – many of whom are internationally recognised as leaders in their fields.&lt;br /&gt;
&lt;br /&gt;
Using the latest technology and infrastructure, our researchers are pioneering new hydrogeological research methods to investigate pressing questions relating to aquifers and aquitards; water flows in complex subterranean systems; and the largely unexplored link between surface water and groundwater.&lt;br /&gt;
&lt;br /&gt;
NCGRT research teams are studying groundwater-dependent ecosystems and the potential impact of climate change, while legal and policy experts are examining the highly complex area of socio-economics, policy-making and management.&lt;br /&gt;
&lt;br /&gt;
Some of the challenges facing our researchers are unique to Australia. They have to contend with:
&lt;/p&gt;
&lt;ul&gt;
	&lt;li&gt;wide ranging climates from arid to tropical&lt;/li&gt;
	&lt;li&gt;topography that is mostly flat, which means that groundwater moves very slowly&lt;/li&gt;
	&lt;li&gt;wetlands and rivers that often disappear in summer&lt;/li&gt;
	&lt;li&gt;high levels of salinity&lt;/li&gt;
	&lt;li&gt;extensive periods of drought.&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;
Through its major training and capacity building program, the NCGRT will deliver an understanding of our groundwater systems that will be critical for Australia’s future water security.&lt;br /&gt;
&lt;br /&gt;
Our Research Programs explore the key questions from the basic understanding of groundwater origins and processes, through groundwater interactions with surface water, vegetation, and the environment, to the decisions we are taking about the management of this resource.&lt;br /&gt;
&lt;/p&gt;
&lt;ul&gt;
	&lt;li&gt;Program 1: Innovative Characterisation of Aquifers and Aquitards&lt;/li&gt;
	&lt;li&gt;Program 2: Hydrodynamics and Modelling of Complex Groundwater Systems&lt;/li&gt;
	&lt;li&gt;Program 3: Surface Water - Groundwater Interactions&lt;/li&gt;
	&lt;li&gt;Program 4: Groundwater-Vegetation-Atmosphere Interactions (GVI)&lt;/li&gt;
	&lt;li&gt;Program 5: Integrating Socioeconomics, Policy and Decision Support&lt;/li&gt;
&lt;/ul&gt;

AusStage is endeavoring to create an extensive index of all performing arts events since European settlement in Australia. As the performing arts is a notoriously difficult activity to categorise, we resolved that the minimum data listed for each event were to be:
				    the name (title);
				    the venue;
				    the date;
				    the production company;
				    the primary genre 
				However, allowance has been made to collect and enter a number of other relevant details, including the origin of the data, citations to articles, reviews, journals and books, links to digitised objects, details on contributors and organisations, etc., 
				There are two categories of data: prospective or current data and retrospective data. This distinction is important because the data-collection techniques vary; current data can be harvested from a variety of publications, providing a weekly snapshot of what goes on throughout the nation. Data harvesting for retrospective events tends to use other sources such as collections of programmes, academic collections, journal articles and digitised newspapers. 
				Prospective (current) data
				Data has been collected since 1 January 2001 by a variety of personnel in various locations around Australia on a weekly basis and entered into the AusStage database. In theory this means that most performing arts events (excluding 'pure' music events such as concerts) are listed in the database, though in practice there will be some gaps: the system of adequate collection is still being fine-tuned and is subject to available personnel and funding. We are making an attempt to include as many country areas as possible and continue to broaden our coverage in this area.
				Retrospective data
				Retrospective data includes a vast quantity of disparate material held in a variety of locations. Ultimately the scope of retrospective data includes all performing arts events ever mounted in Australia since white settlement, where records survive. Thus we are approaching retrospective data entry by identifying 'blocks' of data that can be mined for information. A block of data is a collection of programs or reviews or articles in one location.  
				The ultimate aim is to achieve a 'critical mass' of data so that it can be seen as representative of our performing arts history and thus an essential resource for research.
